-- ----------------------------
-- Table structure for `interact_teach_lesson`
-- ----------------------------
DROP TABLE IF EXISTS `interact_teach_lesson`;
CREATE TABLE `interact_teach_lesson` (
  `ID` varchar(36) NOT NULL,
  `LESSON_TYPE` varchar(36) DEFAULT NULL COMMENT '课堂类型 ：互动教学、精品课堂、会议（默认为进入菜单的课堂类型）可配置',
  `SCHOOL_ID` varchar(36) DEFAULT NULL COMMENT '主讲学校ID 学校表ID',
  `CLASSROOM_ID` varchar(36) DEFAULT NULL COMMENT '主讲教室Id  教室表ID',
  `LESSON_NAME` varchar(50) DEFAULT NULL COMMENT '名称（课表名称或者会议名称）',
  `GRADE_ID` varchar(36) DEFAULT NULL COMMENT '年级（年级表ID）',
  `SUBJECT_ID` varchar(36) DEFAULT NULL COMMENT '学科（科目表ID）',
  `TEACHER_USER_ID` varchar(36) DEFAULT NULL COMMENT '讲主老师ID（用户表ID）',
  `TEACHER_NAME` varchar(50) DEFAULT NULL COMMENT '老师名称',
  `TEACHER_TITLE` varchar(50) DEFAULT NULL COMMENT '老师职称',
  `SCHEDULED_START_DATE` datetime DEFAULT NULL COMMENT '排课起始日期',
  `SCHEDULED_END_DATE` datetime DEFAULT NULL COMMENT '排课结束日期',
  `SCHEDULED_START_TIME` datetime DEFAULT NULL COMMENT '课节计划开课时间',
  `SCHEDULED_END_TIME` datetime DEFAULT NULL COMMENT '课节计划结束时间',
  `ACTUAL__START_TIME` datetime DEFAULT NULL COMMENT '课节实际开课时间',
  `ACTUAL__END_TIME` datetime DEFAULT NULL COMMENT '课节实际结束时间',
  `CHAPTER_ID` varchar(36) DEFAULT NULL COMMENT '章(xg_chapter章表ID)',
  `KNOWLEDGE_ID` varchar(1000) DEFAULT NULL COMMENT '知识点 (xg_knowledge知识点表ID)',
  `SECTION_ID` varchar(36) DEFAULT NULL COMMENT '节(xg_section节表ID)',
  `VERSION_ID` varchar(36) DEFAULT NULL COMMENT '版本ID (参数配置表ID)',
  `AUTO_SMS_NOTICE` tinyint(1) DEFAULT '0' COMMENT '自动发送短信通知0：否1：是',
  `AUTO_EMAIL_NOTICE` tinyint(1) DEFAULT '0' COMMENT '自动发送邮件通知 0：否1:是',
  `AUTO_NOTICE` tinyint(1) DEFAULT '0' COMMENT '自动发布公告 0：否 1：是',
  `PROFILE_ID` varchar(36) DEFAULT NULL COMMENT '模板ID（模板表ID）',
  `CONFERENCE_ID` varchar(50) DEFAULT NULL COMMENT '会议ID|课堂ID',
  `CONFPASSWD` varchar(10) DEFAULT NULL COMMENT '会议密码',
  `CONF_NAME` varchar(50) DEFAULT NULL COMMENT '会议名称（会议别名）',
  `ORDER_NO` varchar(36) DEFAULT NULL COMMENT '课节(xg_order课节表ID)',
  `SEMESTER` tinyint(4) DEFAULT NULL COMMENT '学期 1:上学期 2:下学期    暂时不用',
  `AUTO_UPLOAD_CLOUD` tinyint(1) DEFAULT '0' COMMENT '是否自动上传至云平台 0：否1：是    暂时不用',
  `LIVE_BANDWIDTH` varchar(45) DEFAULT NULL COMMENT '直播带宽   暂时不用',
  `LIVE_FORMAT` varchar(45) DEFAULT NULL COMMENT '直播格式   暂时不用',
  `SEND_TIME` datetime DEFAULT NULL COMMENT '发送时间   暂时不用',
  `SPECIAL_ID` bigint(20) DEFAULT NULL COMMENT '专题ID    暂时不用',
  `AREA_PLAT_MARK` bigint(20) DEFAULT NULL COMMENT '地区平台标识  暂时不用',
  `IS_PUBLIC` tinyint(1) DEFAULT '0' COMMENT '是否公开 1:是 0:否',
  `EMERGENCY_DEGREE` tinyint(6) DEFAULT NULL COMMENT '紧急程度   暂时不用',
  `DELAY_TIME` int(11) DEFAULT NULL COMMENT '延迟时间   暂时不用',
  `AUTO_START` tinyint(1) DEFAULT '0' COMMENT '是否到点后台启动开课  暂时不用',
  `CLASSROOM_NUM` int(20) DEFAULT NULL COMMENT '参与互动教室数量    暂时不用',
  `CONFERENCE_PASSWORD` varchar(50) DEFAULT NULL COMMENT '会议密码|课堂密码    暂时不用',
  `WEEK_DAY` bigint(20) DEFAULT NULL COMMENT '周天  暂时不用',
  `WEEK_NUM` bigint(20) DEFAULT NULL COMMENT '周次  暂时不用',
  `LOCAL_ID` varchar(50) DEFAULT NULL COMMENT '暂时不用',
  `PERMANENT` tinyint(1) DEFAULT '0' COMMENT '永久会议 暂时不用',
  `RECORDING` tinyint(1) DEFAULT '0' COMMENT '是否录制   暂时不用',
  `E164` varchar(10) DEFAULT NULL COMMENT 'E164  暂时不用',
  `CHAIRPASSWD` varchar(10) DEFAULT NULL COMMENT '主席密码  暂时不用',
  `START_TIME` datetime DEFAULT NULL COMMENT '上课时间  暂时不用',
  `END_TIME` datetime DEFAULT NULL COMMENT '下课时间  暂时不用',
  `CREATED` tinyint(1) DEFAULT '0' COMMENT '是否是未来云教室课程：0否1是',
  `AUTO_SWITCH` tinyint(1) DEFAULT '0' COMMENT '平台直播开关 0：关 1：开(默认关)',
  `LIVE_TELECAST` tinyint(1) DEFAULT '0' COMMENT '直播开关 0：关 1：开(默认值跟着平台直播开关走)',
  `LIVE_URL` varchar(100) DEFAULT NULL COMMENT '直播频道地址',
  `DESCRIPTION` varchar(400) DEFAULT NULL COMMENT '描述',
  `ATTENTION_NUMBER` int(11) DEFAULT NULL COMMENT '关注量',
  `IMAGE_URL` varchar(100) DEFAULT NULL COMMENT '视频图片路径',
  `LESSON_STATUS` tinyint(4) DEFAULT '0' COMMENT '课节状态：0未开课，1上课中，2课节已结束',
  `USER_ID` varchar(36) NOT NULL COMMENT '创建人',
  `CREATE_TIME` datetime DEFAULT NULL COMMENT '创建时间',
  `UPDATE_TIME` datetime DEFAULT NULL COMMENT '记录修改时间（课节信息修改时间）',
  `STATUS` tinyint(4) DEFAULT NULL COMMENT '0：新建，1：激活，2：禁用，3：删除',
  `PLAT_MARK` varchar(36) DEFAULT NULL COMMENT '平台租户ID',
  `GROUP_ID` varchar(36) DEFAULT NULL COMMENT '所属组，创建人所在的组（组表xg_school_group  ID）',
  `IS_LIVES` tinyint(4) DEFAULT '0' COMMENT '是否直播过0：未直播过，1直播过',
  `classtable_id` varchar(36) DEFAULT NULL COMMENT '所属课表（课表ID）',
  `INTERACT_TYPE` tinyint(4) DEFAULT '0' COMMENT '互动类型(默认0，0：常规互动类型，1：点对点互动)',
  `focus_num` int(11) DEFAULT '0' COMMENT '关注数量',
  `praise_num` int(11) DEFAULT '0' COMMENT '赞数量',
  `tread_num` int(11) DEFAULT '0' COMMENT '踩数量',
  `read_num` int(11) DEFAULT '0' COMMENT '阅读数量',
  `RECOMMEND_DATE` datetime DEFAULT NULL COMMENT '推荐时间',
  `is_recommend` tinyint(11) DEFAULT NULL COMMENT '是否推荐 0不推荐;1推荐',
  PRIMARY KEY (`ID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='课程表';

-- ----------------------------
-- Records of interact_teach_lesson
-- ----------------------------

