  `create_date` datetime DEFAULT NULL COMMENT '创建时间',
  `FILE_PATH` varchar(200) DEFAULT NULL COMMENT '文件路径',
  `LEARNING_PHASE_ID` varchar(36) DEFAULT NULL COMMENT '学段  ：教育学习阶段（1表示小学，2表示初中，3表示高中）',
  `GRADE_ID` varchar(36) DEFAULT NULL COMMENT '年级',
  `SUBJECT_ID` varchar(36) DEFAULT NULL COMMENT '科目',
  `VERSION_ID` varchar(36) DEFAULT NULL COMMENT '教材',
  `spId` varchar(36) DEFAULT NULL COMMENT '专辑',
  `CHAPTER_SECTION` varchar(1000) DEFAULT NULL COMMENT '章节（ID 多个用“，” 隔开）',
  `SEMESTER` tinyint(4) DEFAULT '1' COMMENT '学期（1表示上学期，2表示下学期）',
  `KNOWLEDGE` varchar(1000) DEFAULT NULL COMMENT '知识点（ID 多个用“，” 隔开）',
  `remark` varchar(1000) DEFAULT NULL COMMENT '描述',
  `SIZE` varchar(20) DEFAULT NULL COMMENT '大小',
  `DURATION` varchar(50) DEFAULT NULL COMMENT '时长',
  `IMAGE_URL` varchar(100) DEFAULT NULL COMMENT '缩略图',
  `KEYWORDS` varchar(100) DEFAULT NULL COMMENT '关键词',
  `COPYRIGHT` varchar(200) DEFAULT NULL COMMENT '版权',
  `RESOLUTION` varchar(50) DEFAULT NULL COMMENT '分辨率（LD流畅，SD标清，HD高清）',
  `EXT` varchar(50) DEFAULT NULL COMMENT '文件后缀名',
  `STAR_LEVEL` float(4,1) DEFAULT NULL COMMENT '评星',
  `PRAISE_NUM` int(11) DEFAULT '0' COMMENT '好评数量',
  `BAD_NUM` int(11) DEFAULT '0' COMMENT '差评数量',
  `is_recommend` tinyint(11) DEFAULT NULL COMMENT '0不推荐1推荐',
  `RECOMMEND_DATE` datetime DEFAULT NULL COMMENT '推荐时间',
  `UPLOAD_DATE` datetime DEFAULT NULL COMMENT '上传日期',
  `upload_userId` varchar(36) DEFAULT NULL COMMENT '上传用户',
  `delete_userId` varchar(36) DEFAULT NULL COMMENT '删除用户',
  `DELETE_DATE` datetime DEFAULT NULL COMMENT '删除日期',
  `STATUS` tinyint(11) DEFAULT NULL COMMENT '资源状态，-2=转码失败，-1=审核未通过， 0=新入库资源，1=用户提交申请，2=审核通过， 3=发布可用，4=取消发布，5=回收站， 6=已删除''',
  `audit_userId` varchar(36) DEFAULT NULL COMMENT '审核用户',
  `play_num` bigint(20) DEFAULT '0' COMMENT '播放数量',
  `collect_num` bigint(20) DEFAULT '0' COMMENT '收藏数量',
  `AREA_PLAT_MARK` varchar(36) DEFAULT NULL COMMENT '地区标识',
  `SCHOOL_PLAT_MARK` varchar(36) DEFAULT NULL COMMENT '学校标识',
  `PLAT_MARK` varchar(36) DEFAULT NULL COMMENT '平台租户ID',
  `is_open` int(11) DEFAULT NULL COMMENT '是否公开（1，是，0，否）',
  `fpid` varchar(36) DEFAULT NULL COMMENT '文件包主键',
  `download_num` int(11) DEFAULT '0' COMMENT '下载数量',
  `trans_status` int(10) DEFAULT NULL COMMENT '转码状态：0-转码失败；1-转码中；2-转码成功；',
  `source` int(11) DEFAULT NULL COMMENT '来源：0-资源；1-录播',
  `source_id` varchar(36) DEFAULT NULL COMMENT '录播资源id',
  PRIMARY KEY (`vId`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='视频表';

