-- ----------------------------
-- Function structure for `baseareatree`
-- ----------------------------
DROP FUNCTION IF EXISTS `baseareatree`;
DELIMITER ;;
CREATE DEFINER=`demo`@`%` FUNCTION `baseareatree`(`areaId` varchar(60)) RETURNS varchar(4000) CHARSET utf8
BEGIN
	#Routine body goes here...
	DECLARE sTemp VARCHAR(4000);

	DECLARE sTempChd VARCHAR(4000);


	SET sTemp = '$';

	SET sTempChd = cast(areaId as char);


	WHILE sTempChd is not NULL DO

	SET sTemp = CONCAT(sTemp,',',sTempChd);

	SELECT group_concat(id) INTO sTempChd FROM base_area where FIND_IN_SET(PARENT_ID,sTempChd)>0;

	END WHILE;

	return sTemp;

END
;;
DELIMITER ;

-- ----------------------------
-- Function structure for `getChildList`
-- ----------------------------
DROP FUNCTION IF EXISTS `getChildList`;
DELIMITER ;;
CREATE DEFINER=`demo`@`%` FUNCTION `getChildList`(`areaId` varchar(60)) RETURNS varchar(1000) CHARSET utf8
BEGIN
      DECLARE sChildList VARCHAR(1000);
      DECLARE sChildTemp VARCHAR(1000);
      SET sChildTemp =cast(areaId as CHAR);
      WHILE sChildTemp is not null DO
        IF (sChildList is not null) THEN
          SET sChildList = concat(sChildList,',',sChildTemp);
    ELSE
      SET sChildList = concat(sChildTemp);
    END IF;
        SELECT group_concat(id) INTO sChildTemp FROM area where FIND_IN_SET(PARENT_ID,sChildTemp)>0;
      END WHILE;
      RETURN sChildList;
    END
;;
DELIMITER ;

-- ----------------------------
-- Function structure for `getParentList`
-- ----------------------------
DROP FUNCTION IF EXISTS `getParentList`;
DELIMITER ;;
CREATE DEFINER=`demo`@`%` FUNCTION `getParentList`(`areaId` varchar(60)) RETURNS varchar(4000) CHARSET utf8
BEGIN
	#Routine body goes here...
	DECLARE sTemp VARCHAR(4000);

	DECLARE sTempChd VARCHAR(4000);


	SET sTemp = '$';

	SET sTempChd = cast(areaId  as char);


	WHILE sTempChd is not NULL DO

	SET sTemp = CONCAT(sTemp,',',sTempChd);

	SELECT group_concat(PARENT_ID) INTO sTempChd FROM area where FIND_IN_SET(id,sTempChd)>0;

	END WHILE;

	return sTemp;

END
;;
DELIMITER ;

-- ----------------------------
-- Function structure for `moduletree`
-- ----------------------------
DROP FUNCTION IF EXISTS `moduletree`;
DELIMITER ;;
CREATE DEFINER=`demo`@`%` FUNCTION `moduletree`(`moduleId` varchar(60)) RETURNS varchar(4000) CHARSET utf8
BEGIN
	#Routine body goes here...
	DECLARE sTemp VARCHAR(4000);

	DECLARE sTempChd VARCHAR(4000);


	SET sTemp = '$';

	SET sTempChd = cast(moduleId as char);


	WHILE sTempChd is not NULL DO

	SET sTemp = CONCAT(sTemp,',',sTempChd);

	SELECT group_concat(id) INTO sTempChd FROM auth_module where FIND_IN_SET(PARENT_ID,sTempChd)>0;

	END WHILE;

	return sTemp;

END
;;
DELIMITER ;

-- ----------------------------
-- Function structure for `queryChildrenAreaInfo`
-- ----------------------------
DROP FUNCTION IF EXISTS `queryChildrenAreaInfo`;
DELIMITER ;;
CREATE DEFINER=`demo`@`%` FUNCTION `queryChildrenAreaInfo`(Id INT) RETURNS varchar(4000) CHARSET utf8
BEGIN
		DECLARE sTemp VARCHAR(4000);
		DECLARE sTempChd VARCHAR(4000);
		
		SET sTemp = '$';
		SET sTempChd = cast('0001' as char);
		
		WHILE sTempChd is not NULL DO
		SET sTemp = CONCAT(sTemp,',',sTempChd);
		SELECT group_concat(pfId) INTO sTempChd FROM zy_file_package where FIND_IN_SET(parent_id,sTempChd)>0;
		END WHILE;
		return sTemp;
		END
;;
DELIMITER ;
