  `id` varchar(36) NOT NULL,
  `userid` varchar(36) DEFAULT NULL COMMENT '处理人',
  `createdate` datetime DEFAULT NULL COMMENT '创建时间',
  `remark` text COMMENT '处理记录',
  `repair_id` varchar(50) DEFAULT NULL,
  `disposedate` datetime DEFAULT NULL COMMENT '处理时间',
  PRIMARY KEY (`id`),
  KEY `fk-bx_dispose-bx_repair` (`repair_id`),
