  PRIMARY KEY (`id`),
  KEY `dispose_id` (`dispose_id`),
  CONSTRAINT `bx_equipment_ibfk_1` FOREIGN KEY (`dispose_id`) REFERENCES `bx_dispose` (`id`) ON DELETE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='故障设备表';

