-- 新增分层数据同步下发配置表
CREATE TABLE `lvsync_down_cfg` (
  `uuid` varchar(36) NOT NULL,
  `local_platmark` varchar(36) DEFAULT NULL COMMENT '本地租户标识',
  `data_local_areacd` varchar(36) DEFAULT NULL COMMENT '数据地区本地编码',
  `data_local_plat` varchar(36) DEFAULT NULL COMMENT '数据租户本地标识',
  `data_remote_areacd` varchar(36) DEFAULT NULL COMMENT '数据地区远程编码',
  `data_remote_areanm` varchar(36) DEFAULT NULL COMMENT '数据地区远程名称',
  `data_remote_platid` varchar(36) DEFAULT NULL COMMENT '数据租户远程标识',
  `data_remote_platnm` varchar(36) DEFAULT NULL COMMENT '数据租户远程名称',
  `service_ip` varchar(255) DEFAULT NULL COMMENT '同步服务IP',
  `service_port` int(11) DEFAULT NULL COMMENT '同步服务端口',
  `service_name` varchar(100) DEFAULT NULL COMMENT '同步服务名称',
  `service_user` varchar(100) DEFAULT NULL COMMENT '同步服务用户名',
  `service_pwd` varchar(100) DEFAULT NULL COMMENT '同步服务密码',
  `service_url` varchar(255) DEFAULT NULL COMMENT '同步服务URL',
  `is_ssl` smallint(6) DEFAULT NULL COMMENT '是否SSL',
  `status` smallint(6) DEFAULT NULL COMMENT '状态：0：新建，1：激活，2：禁用，3：删除',
  `remark` varchar(255) DEFAULT NULL COMMENT '描述',
  PRIMARY KEY (`uuid`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='分层数据同步下发配置表';

-- 分层数据同步上传配置表
CREATE TABLE `lvsync_up_cfg` (
  `uuid` varchar(36) NOT NULL,
  `is_automatic` char(1) DEFAULT NULL COMMENT '是否自动同步：1 是 0否',
  `manner` smallint(6) DEFAULT NULL COMMENT '方式：1定时（每天的某个时间点）0循环（每隔多少分钟）',
  `timing_time` int(11) DEFAULT NULL COMMENT '定时同步时间，每天什么时间同步，从0点开始的分钟数',
  `minutes` int(11) DEFAULT NULL COMMENT '循环同步时间间隔，每个多少分钟同步一次',
  `local_platmark` varchar(36) DEFAULT NULL COMMENT '本地租户标识',
  `data_local_areacd` varchar(36) DEFAULT NULL COMMENT '数据地区本地编码',
  `data_local_plat` varchar(36) DEFAULT NULL COMMENT '数据租户本地标识',
  `data_remote_areacd` varchar(36) DEFAULT NULL COMMENT '数据地区远程编码',
  `data_remote_areanm` varchar(36) DEFAULT NULL COMMENT '数据地区远程名称',
  `data_remote_platid` varchar(36) DEFAULT NULL COMMENT '数据租户远程标识',
  `data_remote_platnm` varchar(36) DEFAULT NULL COMMENT '数据租户远程名称',
  `service_ip` varchar(255) DEFAULT NULL COMMENT '同步服务IP',
  `service_port` int(11) DEFAULT NULL COMMENT '同步服务端口',
  `service_name` varchar(100) DEFAULT NULL COMMENT '同步服务名称',
  `service_user` varchar(100) DEFAULT NULL COMMENT '同步服务用户名',
  `service_pwd` varchar(100) DEFAULT NULL COMMENT '同步服务密码',
  `service_url` varchar(255) DEFAULT NULL COMMENT '同步服务URL',
  `is_ssl` char(1) DEFAULT NULL COMMENT '是否SSL',
  `status` smallint(6) DEFAULT NULL COMMENT '状态：0：新建，1：激活，2：禁用，3：删除',
  `remark` varchar(255) DEFAULT NULL COMMENT '描述',
  PRIMARY KEY (`uuid`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='分层数据同步上传配置表';

-- 分层数据同步地区记录表,存储下级地区是否已经同步过的记录
CREATE TABLE `lvsync_record` (
  `uuid` varchar(36) NOT NULL,
  `baseareaid` varchar(36) NOT NULL COMMENT '关联base_area表的外键',
  `direction` smallint(6) NOT NULL COMMENT '同步方向：1由上往下 0由下往上',
  `sync_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '同步时间',
  `status` smallint(6) DEFAULT NULL COMMENT '状态，0-无效，1-有效',
  PRIMARY KEY (`uuid`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='分层数据同步地区记录表,存储下级地区是否已经同步过的记录';

-- 分层数据同步日志表
CREATE TABLE `lvsync_logs` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `taskno` varchar(36) NOT NULL COMMENT '任务UUID',
  `data_source` smallint(6) DEFAULT NULL COMMENT '数据来源：1-上级下发 2-下级上传',
  `log_type` smallint(6) DEFAULT NULL COMMENT '日志类型：1-推送2-接收',
  `local_platform` varchar(36) DEFAULT NULL COMMENT '本地租户标识',
  `local_areacd` varchar(36) DEFAULT NULL COMMENT '本地数据地区',
  `push_addr` varchar(255) DEFAULT NULL COMMENT '推送地址',
  `push_areacd` varchar(36) DEFAULT NULL COMMENT '推送地区',
  `push_plat` varchar(100) DEFAULT NULL COMMENT '推送平台标识',
  `receive_addr` varchar(36) DEFAULT NULL COMMENT '接收地址',
  `receive_areacd` varchar(36) DEFAULT NULL COMMENT '接收地区',
  `receive_plat` varchar(36) DEFAULT NULL COMMENT '接收平台标识',
  `push_start` datetime DEFAULT NULL COMMENT '推送开始时间',
  `push_finish` datetime DEFAULT NULL COMMENT '推送完成时间',
  `exec_start` datetime DEFAULT NULL COMMENT '执行开始时间',
  `exec_finish` datetime DEFAULT NULL COMMENT '执行完成时间',
  `exec_mode` smallint(6) DEFAULT NULL COMMENT '执行方式，1-自动，2-手动',
  `exec_user` varchar(36) DEFAULT NULL COMMENT '执行方式为手动的执行用户',
  `data_status` smallint(6) DEFAULT NULL COMMENT '数据状态：0-未接收 1-拒绝接收 2-接收中 3-接收失败 4-接收完成 5-已执行,6-执行失败',
  `config_id` varchar(36) DEFAULT NULL COMMENT '推送时的配置标识',
  `content` mediumtext COMMENT '同步日志',
  `rcdstatus` char(1) DEFAULT NULL COMMENT '记录状态 0-删除记录,1-有效记录',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='分层数据同步日志表';
