INSERT INTO `zy_school_reputation` VALUES ('7d309a70-e309-4222-b034-6aa2345948cd', '南京集庆门大学', '/20160203/20160203092745677544.jpg', '战争是人类的“生死劫”是避无可避的，美国人的经济战、货币战是为战争打前站的，一但国家出现混乱，就会有外部势力介入，出钱出物支持内斗，强军是当下的第一要务，一但南海有事先灾菲律宾、东海有事直灭日本，美狗必然望风而逃。全国人民务必团结一心，不要内乱，不要肆意狂喷国家，我们都是生活在“中华号”这艘船上的个体，国家兴亡匹配有责，先国后家才是当下的每一个中国人该做的事情。', '3', '2016-02-03 09:22:00', '1c7185ce-0b1a-49e9-9ea1-8d9d7650e161', 'bf9423b6-5391-4ffe-b3cf-aca458c4e48c', 'd4e0566f-54d4-470d-bbf2-ac6ed4e672cb', '29a5349d-aee2-4c30-894e-47124f4c6083', '/20160203/20160203092748988943.jpg', '', 'c5da4603-934d-4a6c-a705-4d7a0864122e', '8dab4e67-8cdd-49d5-ad3c-c4281c5f6152');
